            this.lb5.Text = "    3、全身麻醉及气管插管可能导致牙齿松动或脱落、反流、误吸、吸入性肺炎、支气管哮喘、喉痉挛、喉水肿、气道阻塞、声音嘶哑、躁动、苏醒延迟等。";
