            this.lb6.Text = "    4、腰麻、硬膜外麻醉及外周神经阻滞可能出现局麻药中毒、术后头痛、腰疼、尿潴留、神经损伤、上下肢感觉或运动障碍、硬膜外血肿、感染、全脊麻、局部血肿、气胸等并" +
